export const crumbsModule = {
  state: () => ({
    paths: [{ name: "Профиль", path: "/rol-shop/profile" }],
  }),
  mutations: {
    setCrumbsModule(state, crumbsModule) {
      state.crumbsModule = crumbsModule;
    }
  },
  namespaced: true
};
